import React from 'react';
import { Link } from 'react-router-dom';
import './Profile.css'; // Import your CSS file here
import farmImage from './img/fin.jpg'; // Import your images here

const Profile = () => {
  return (
    <div className="profile-page">
      <div className="profile-picture">
        <img src={farmImage} alt="Farm" className="profile-img" />
      </div>
      <div className="dashboard">
        <h2 className="dashboard-title">List of Farms</h2>
        <div className="farms">
          <div className="farm">
            <img src={farmImage} alt="Farm" className="farm-img" />
            <div className="details">
              <h2 className="fName">Farm name</h2>
              <p className="fLoc">Location</p>
            </div>
            <button className="Editfbtn" role="button">
              <Link to="/editfarm" className="edit-link">Edit Farm</Link>
            </button>
          </div>
          {/* Add more farms here */}
        </div>
      </div>
    </div>
  );
}

export default Profile;
